import junegull from '../fonts/junegull.ttf';
import { createGlobalStyle } from 'styled-components';

export const Fonts = styled.div`
@font-face {
    font-family: 'Junegull';
    src: local('Junegull'),
    url(${ junegull }) format('ttf');
    font-weight: 300;
    font-style: normal;
}
`;
